Booking: 
  type: object
  properties:
    title: 
      type: string
      example: "Join A meeting"
    start:
      type: string
      example: 20190412T120000Z
    end:
      type: string
      example: 20190412T140000Z
    priority:
      type: string
      example: "Not/Low priority/Middle priority/High priority/Fixed"
    attendees:
      type: array
      items:
        type: string
      example: ["0x228d01ABE7ca1E24A2d4fE33F633712eE59e6c81","0x228d01ABE7ca1E24A2d4fE33F633712eE59e6c82","0x228d01ABE7ca1E24A2d4fE33F633712eE59e6c83"]
    summary:
      type: string
      example: "Start at 12:00"

      
      